import React from 'react';
import {Typography, TextField, Grid, Card, Box, FormControl } from '@mui/material';
import { FormatListNumbered } from '@mui/icons-material';

export default function Dashboard() {
    return (
        <>
            <Typography variant="h2" align="center" color="textPrimary" gutterBottom>
                Dashboard
            </Typography>
            <Box sx={{ width: '100%' }}>
                <FormControl>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <TextField id="outlined-size-small" label="Title" variant="outlined" size="small" />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                id="outlined-multiline-flexible"
                                label="Description"
                                multiline
                                rows={4}
                                value={'value'}
                            />
                        </Grid>
                    </Grid>                    
                </FormControl>
            </Box>
        </>
    )
}
